import './App.css'
import React from 'react';
import TopBar from "./Components/TopBar";
import TripList from "./Components/TripList";
import Stats from "./Components/Stats";
import receipt from './ocr/images/receipt.png';
import { Tesseract } from 'tesseract.js';

const worker = Tesseract.TesseractWorker({
  workerPath: 'https://unpkg.com/tesseract.js@v2.0.0-alpha.11/dist/worker.min.js',
  langPath: 'https://tessdata.projectnaptha.com/4.0.0',
  corePath: 'https://unpkg.com/tesseract.js-core@v2.0.0-beta.10/tesseract-core.wasm.js',
});

worker
  .recognize('https://tesseract.projectnaptha.com/img/eng_bw.png')
  .progress((p) => {
    console.log('progress', p);
  })
  .then(({ text }) => {
    console.log(text);
    worker.terminate();
  });


Tesseract.recognize(receipt,{lang : 'eng'}).then(result => {
    let text=result.text
    console.log(text)
})

class App extends React.Component{
  state = {
    collapsed: false,
  };

  render(){
    return (
        <div>
            <TopBar/>
            <div style={{display:"flex", flexDirection:"row", justifyContent:"space-around"}}>
                <Stats/>
                <div style={{border : '0.2px solid black', marginTop : '40px'}}>
                </div>
                <TripList/>
            </div>
        </div>

    );
  }
}

export default App;
